svg.script:
/* Particle system injected by make_particle_svg.py */
(function(){

class ParticleSystem {
    constructor(svgElement, options = {}) {
        this.svg = svgElement;
        this.particles = [];
        this.animationId = null;
        this.isRunning = false;
        this.options = options || {};
        this.avgSpeed = this.options.avgSpeed || 1.0;

        // track offsets (viewBox origin) in addition to width/height
        this.offsetX = 0;
        this.offsetY = 0;
        this.width = 0;
        this.height = 0;

        // Set SVG size + offsets
        this.updateSize();
        // Try to handle window resize if embedded in a page
        if (typeof window !== 'undefined' && window.addEventListener) {
            window.addEventListener('resize', () => this.updateSize());
        }

        // Particle counts (initial, may be changed externally)
        this.counts = {
            electron: 15,
            proton: 10,
            atom: 5
        };

        // Particle properties (radii, base color, base speed)
        this.properties = {
            electron: {
                radius: 2,
                color: '#4cc9f0',
                speed: 2.5 * this.avgSpeed,
                glow: true
            },
            proton: {
                radius: 4,
                color: '#f72585',
                speed: 1.8 * this.avgSpeed,
                glow: true
            },
            atom: {
                radius: 5,
                color: '#7209b7',
                speed: 1.2 * this.avgSpeed,
                glow: true
            }
        };
    }

    updateSize() {
        // Prefer explicit viewBox when available (use x/y as offset)
        const vb = (this.svg && this.svg.viewBox && this.svg.viewBox.baseVal) ? this.svg.viewBox.baseVal : null;
        if (vb && vb.width && vb.height) {
            this.width = vb.width;
            this.height = vb.height;
            // some SVGs have non-zero origin: honor that
            this.offsetX = (typeof vb.x === 'number') ? vb.x : 0;
            this.offsetY = (typeof vb.y === 'number') ? vb.y : 0;
            return;
        }

        // Fallback: use bounding box of contents (getBBox) or client size
        try {
            const bbox = this.svg.getBBox();
            this.width = bbox.width || this.svg.clientWidth || this.svg.getBoundingClientRect().width || 0;
            this.height = bbox.height || this.svg.clientHeight || this.svg.getBoundingClientRect().height || 0;
            this.offsetX = (typeof bbox.x === 'number') ? bbox.x : 0;
            this.offsetY = (typeof bbox.y === 'number') ? bbox.y : 0;
        } catch (e) {
            // getBBox can throw in some contexts; fallback to clientRect
            const rect = this.svg.getBoundingClientRect();
            this.width = rect.width || this.svg.clientWidth || 0;
            this.height = rect.height || this.svg.clientHeight || 0;
            this.offsetX = 0;
            this.offsetY = 0;
        }
    }

    createParticle(type, x = null, y = null) {
        const props = this.properties[type];

        const group = document.createElementNS('http://www.w3.org/2000/svg', 'g');

        // main circle
        const circle = document.createElementNS('http://www.w3.org/2000/svg', 'circle');
        circle.setAttribute('r', props.radius);
        circle.setAttribute('fill', props.color);
        circle.setAttribute('opacity', this.options.particleOpacity);


        if (props.glow) {
            const filterId = `glow-${type}`;
            this.addGlowFilter(filterId, props.color);
            circle.setAttribute('filter', `url(#${filterId})`);
        }

        group.appendChild(circle);

        // orbital rings for 'atom' type
        if (type === 'atom') {
            const ring1 = document.createElementNS('http://www.w3.org/2000/svg', 'circle');
            ring1.setAttribute('r', props.radius * 2.5);
            ring1.setAttribute('fill', 'none');
            ring1.setAttribute('stroke', props.color);
            ring1.setAttribute('stroke-width', '0.5');
            ring1.setAttribute('stroke-opacity', '0.6');
            group.appendChild(ring1);

            const ring2 = document.createElementNS('http://www.w3.org/2000/svg', 'circle');
            ring2.setAttribute('r', props.radius * 1.8);
            ring2.setAttribute('fill', 'none');
            ring2.setAttribute('stroke', props.color);
            ring2.setAttribute('stroke-width', '0.5');
            ring2.setAttribute('stroke-opacity', '0.4');
            ring2.setAttribute('transform', 'rotate(45)');
            ring1.setAttribute('opacity', this.options.particleOpacity * 0.6);
            ring2.setAttribute('opacity', this.options.particleOpacity * 0.4);
            group.appendChild(ring2);
        }

        // If x/y provided, use them (caller override). Otherwise random across full view-box extents,
        // including any viewBox origin offset.
        const posX = (typeof x === 'number') ? x : (this.offsetX + Math.random() * this.width);
        const posY = (typeof y === 'number') ? y : (this.offsetY + Math.random() * this.height);
        group.setAttribute('transform', `translate(${posX}, ${posY})`);

        const angle = Math.random() * Math.PI * 2;
        const velocity = {
            x: Math.cos(angle) * props.speed,
            y: Math.sin(angle) * props.speed
        };

        const particle = {
            element: group,
            type: type,
            x: posX,
            y: posY,
            velocity: velocity,
            properties: props
        };

        // append to svg (particles group is created externally)
        let particlesGroup = this.svg.querySelector('#particles-layer');
        if (!particlesGroup) {
            particlesGroup = document.createElementNS('http://www.w3.org/2000/svg', 'g');
            particlesGroup.setAttribute('id', 'particles-layer');
            // ensure it's appended at the end so particles are rendered on top
            this.svg.appendChild(particlesGroup);
        }
        particlesGroup.appendChild(group);

        this.particles.push(particle);
        return particle;
    }

    addGlowFilter(id, color) {
        if (this.svg.querySelector('#' + id)) return;
        let defs = this.svg.querySelector('defs');
        if (!defs) {
            defs = document.createElementNS('http://www.w3.org/2000/svg', 'defs');
            this.svg.insertBefore(defs, this.svg.firstChild);
        }
        const filter = document.createElementNS('http://www.w3.org/2000/svg', 'filter');
        filter.setAttribute('id', id);

        const feGaussianBlur = document.createElementNS('http://www.w3.org/2000/svg', 'feGaussianBlur');
        feGaussianBlur.setAttribute('stdDeviation', '3');
        feGaussianBlur.setAttribute('result', 'coloredBlur');

        const feMerge = document.createElementNS('http://www.w3.org/2000/svg', 'feMerge');
        const feMergeNode1 = document.createElementNS('http://www.w3.org/2000/svg', 'feMergeNode');
        feMergeNode1.setAttribute('in', 'coloredBlur');
        const feMergeNode2 = document.createElementNS('http://www.w3.org/2000/svg', 'feMergeNode');
        feMergeNode2.setAttribute('in', 'SourceGraphic');

        feMerge.appendChild(feMergeNode1);
        feMerge.appendChild(feMergeNode2);

        filter.appendChild(feGaussianBlur);
        filter.appendChild(feMerge);
        defs.appendChild(filter);
    }

    update() {
        for (const particle of this.particles) {
            particle.x += particle.velocity.x;
            particle.y += particle.velocity.y;

            // bounce against viewBox origin + extents
            const minX = this.offsetX;
            const maxX = this.offsetX + this.width;
            const minY = this.offsetY;
            const maxY = this.offsetY + this.height;

            if (particle.x <= minX || particle.x >= maxX) {
                particle.velocity.x *= -1;
                particle.x = Math.max(minX, Math.min(maxX, particle.x));
            }
            if (particle.y <= minY || particle.y >= maxY) {
                particle.velocity.y *= -1;
                particle.y = Math.max(minY, Math.min(maxY, particle.y));
            }

            // occasional random direction change
            if (Math.random() < 0.02) {
                const angle = Math.random() * Math.PI * 2;
                const speed = Math.sqrt(particle.velocity.x * particle.velocity.x + particle.velocity.y * particle.velocity.y);
                particle.velocity.x = Math.cos(angle) * speed;
                particle.velocity.y = Math.sin(angle) * speed;
            }

            particle.element.setAttribute('transform', `translate(${particle.x}, ${particle.y})`);

            // rotate orbital rings for atoms
            if (particle.type === 'atom') {
                const rings = particle.element.querySelectorAll('circle');
                if (rings.length > 1) {
                    const rotation = (particle.x + particle.y) * 0.5;
                    rings[1].setAttribute('transform', `rotate(${rotation})`);
                    if (rings[2]) {
                        rings[2].setAttribute('transform', `rotate(${-rotation * 0.7})`);
                    }
                }
            }
        }
    }

    start() {
        if (this.isRunning) return;
        this.isRunning = true;
        const animate = () => {
            if (!this.isRunning) return;
            this.update();
            this.animationId = window.requestAnimationFrame(animate);
        };
        animate();
    }

    stop() {
        this.isRunning = false;
        if (this.animationId) {
            window.cancelAnimationFrame(this.animationId);
            this.animationId = null;
        }
    }

    initialize() {
        // Clear only previously added particles (leave mesh content intact)
        const layer = this.svg.querySelector('#particles-layer');
        if (layer) {
            while (layer.firstChild) layer.removeChild(layer.firstChild);
        }
        this.particles = [];

        for (let i = 0; i < this.counts.electron; i++) this.createParticle('electron');
        for (let i = 0; i < this.counts.proton; i++) this.createParticle('proton');
        for (let i = 0; i < this.counts.atom; i++) this.createParticle('atom');

        this.start();
    }
}

// initialize on DOMContentLoaded
document.addEventListener('DOMContentLoaded', function() {
    const svg = document.getElementById('base-svg') || document.querySelector('svg');
    if (!svg) return;
    // create and start the particle system
    const ps = new ParticleSystem(svg, { avgSpeed: 0.5, particleOpacity: 0.9});
    // counts already baked in, but you may modify them here dynamically if desired
    ps.initialize();

    // Expose ps to window for debugging / interactive changes in browser console
    if (typeof window !== 'undefined') window._particleSystem = ps;
});
})();
